10.body:
Typical Rust application starts with the fn main() function called by the operating system. Smart contracts are not significantly different. When the message is sent to the contract, a function called "entry point" is called. Unlike native applications, which have only a single main entry point, smart contracts have a couple corresponding to different message types: instantiate, execute, query, sudo, migrate and more. To start, we will go with three basic entry points: instantiate which is called once per smart contract lifetime - you can think about it as a constructor or initializer of a contract. execute for handling messages which are able to modify contract state - they are used to perform some actual actions. query for handling messages requesting some information from a contract; unlike execute, they can never affect any contract state, and are used just like database queries. Go to your src/lib.rs file, and start with an instantiate entry point: use cosmwasm_std::{ entry_point, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
}; #[entry_point]
pub fn instantiate( _deps: DepsMut, _env: Env, _info: MessageInfo, _msg: Empty,
) -> StdResult<Response> { Ok(Response::new())
} In fact, instantiate is the only entry point required for a smart contract to be valid. It is not very useful in this form, but it is a start. Let's take a closer look at the entry point structure. First, we start with importing couple of types just for more consistent usage. Then we define our entry point. The instantiate takes four arguments: deps: DepsMut is a utility type for communicating with the outer world - it allows querying and updating the contract state, querying other contracts state, and gives access to an Api object with a couple of helper functions for dealing with CW addresses. env: Env is an object representing the blockchains state when executing the message - the chain height and id, current timestamp, and the called contract address. info: MessageInfo contains metainformation about the message which triggered an execution - an address that sends the message, and chain native tokens sent with the message. msg: Empty is the message triggering execution itself - for now, it is Empty type that represents {} JSON, but the type of this argument can be anything that is deserializable, and we will pass more complex types here in the future. If you are new to the blockchain, those arguments may not have much sense to you, but while progressing with this guide, I will explain their usage one by one. Notice an essential attribute decorating our entry point #[entry_point] . Its purpose is to wrap the whole entry point to the form Wasm runtime understands. The proper Wasm entry points can use only basic types supported natively by Wasm specification, and Rust structures and enums are not in this set. Working with such entry points would be rather overcomplicated, so CosmWasm creators delivered the entry_point macro. It creates the raw Wasm entry point, calling the decorated function internally and doing all the magic required to build our high-level Rust arguments from arguments passed by Wasm runtime. The next thing to look at is the return type. I used StdResult<Response> for this simple example, which is an alias for Result<Response, StdError>. The return entry point type would always be a Result type, with some error type implementing ToString trait and a well-defined type for success case. For most entry points, an "Ok" case would be the Response type that allows fitting the contract into our actor model, which we will discuss very soon. The body of the entry point is as simple as it could be - it always succeeds with a trivial empty response.

15.body:
We have a query, but there is a problem with the query message. It is always an empty JSON. It is terrible - if we would like to add another query in the future, it would be difficult to have any reasonable distinction between query variants. In practice, we address this by using a non-empty query message type. Improve our contract: # use cosmwasm_std::{
# entry_point, to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# use serde::{Deserialize, Serialize};
# # #[derive(Serialize, Deserialize)]
# struct QueryResp {
# message: String,
# }
#
#[derive(Serialize, Deserialize)]
pub enum QueryMsg { Greet {},
} # #[entry_point]
# pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
#
#[entry_point]
pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> { use QueryMsg::*; match msg { Greet {} => { let resp = QueryResp { message: "Hello World".to_owned(), }; to_binary(&resp) } }
} Now we introduced a proper message type for the query message. It is an enum , and by default, it would serialize to a JSON with a single field - the name of the field will be an enum variant (in our case - always "greet" - at least for now), and the value of this field would be an object assigned to this enum variant. Note that our enum has no type assigned to the only Greet variant. Typically in Rust, we create such variants without additional {} after the variant name. Here the curly braces have a purpose - without them, the variant would serialize to just a string type - so instead of { "greet": {} }, the JSON representation of this variant would be "greet". This behavior brings inconsistency in the message schema. It is, generally, a good habit to always add the {} to serde serializable empty enum variants - for better JSON representation. But now, we can still improve the code further. Right now, the query function has two responsibilities. The first is obvious - handling the query itself. It was the first assumption, and it is still there. But there is a new thing happening there - the query message dispatching. It may not be obvious, as there is a single variant, but the query function is an excellent way to become a massive unreadable match statement. To make the code more SOLID , we will refactor it and take out handling the greet message to a separate function. # use cosmwasm_std::{
# entry_point, to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# use serde::{Deserialize, Serialize};
# #[derive(Serialize, Deserialize)]
pub struct GreetResp { message: String,
} # #[derive(Serialize, Deserialize)]
# pub enum QueryMsg {
# Greet {},
# }
# # #[entry_point]
# pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
# #[entry_point]
pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> { use QueryMsg::*; match msg { Greet {} => to_binary(&query::greet()?), }
} mod query { use super::*; pub fn greet() -> StdResult<GreetResp> { let resp = GreetResp { message: "Hello World".to_owned(), }; Ok(resp) }
} Now it looks much better. Note there are a couple of additional improvements. I renamed the query-response type GreetResp as I may have different responses for different queries. I want the name to relate only to the variant, not the whole message. Next is enclosing my new function in the module query. It makes it easier to avoid name collisions - I can have the same variant for queries and execution messages in the future, and their handlers would lie in separate namespaces. A questionable decision may be returning StdResult instead of GreetResp from greet function, as it would never return an error. It is a matter of style, but I prefer consistency over the message handler, and the majority of them would have failure cases - e.g. when reading the state. Also, you might pass deps and env arguments to all your query handlers for consistency. I'm not too fond of this, as it introduces unnecessary boilerplate which doesn't read well, but I also agree with the consistency argument - I leave it to your judgment.

16.body:
You can see that our contract is becoming a bit bigger now. About 50 lines are maybe not so much, but there are many different entities in a single file, and I think we can do better. I can already distinguish three different types of entities in the code: entry points, messages, and handlers. In most contracts, we would divide them across three files. Start with extracting all the messages to src/msg.rs: use serde::{Deserialize, Serialize}; #[derive(Serialize, Deserialize)]
pub struct GreetResp { pub message: String,
} #[derive(Serialize, Deserialize)]
pub enum QueryMsg { Greet {},
} You probably noticed that I made my GreetResp fields public. It is because they have to be now accessed from a different module. Now move forward to the src/contract.rs file: use crate::msg::{GreetResp, QueryMsg};
use cosmwasm_std::{ to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
}; pub fn instantiate( _deps: DepsMut, _env: Env, _info: MessageInfo, _msg: Empty,
) -> StdResult<Response> { Ok(Response::new())
} pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> { use QueryMsg::*; match msg { Greet {} => to_binary(&query::greet()?), }
} mod query { use super::*; pub fn greet() -> StdResult<GreetResp> { let resp = GreetResp { message: "Hello World".to_owned(), }; Ok(resp) }
} I moved most of the logic here, so my src/lib.rs is just a very thin library entry with nothing else but module definitions and entry points definition. I removed the #[entry_point] attribute from my query function in src/contract.rs. I will have a function with this attribute. Still, I wanted to split functions' responsibility further - not the contract::query function is the top-level query handler responsible for dispatching the query message. The query function on crate-level is only an entry point. It is a subtle distinction, but it will make sense in the future when we would like not to generate the entry points but to keep the dispatching functions. I introduced the split now to show you the typical contract structure. Now the last part, the src/lib.rs file: use cosmwasm_std::{ entry_point, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
}; mod contract;
mod msg; #[entry_point]
pub fn instantiate(deps: DepsMut, env: Env, info: MessageInfo, msg: Empty) -> StdResult<Response>
{ contract::instantiate(deps, env, info, msg)
} #[entry_point]
pub fn query(deps: Deps, env: Env, msg: msg::QueryMsg) -> StdResult<Binary>
{ contract::query(deps, env, msg)
} Straightforward top-level module. Definition of submodules and entry points, nothing more. Now, when we have the contract ready to do something, let's go and test it.

17.body:
Last time we created a new query, now it is time to test it out. We will start with the basics - the unit test. This approach is simple and doesn't require knowledge besides Rust. Go to the src/contract.rs and add a test in its module: # use crate::msg::{GreetResp, QueryMsg};
# use cosmwasm_std::{
# to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# # pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
# # pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> {
# use QueryMsg::*;
# # match msg {
# Greet {} => to_binary(&query::greet()?),
# }
# }
# # mod query {
# use super::*;
# # pub fn greet() -> StdResult<GreetResp> {
# let resp = GreetResp {
# message: "Hello World".to_owned(),
# };
# # Ok(resp)
# }
# }
# #[cfg(test)]
mod tests { use super::*; #[test] fn greet_query() { let resp = query::greet().unwrap(); assert_eq!( resp, GreetResp { message: "Hello World".to_owned() } ); }
} If you ever wrote a unit test in Rust, nothing should surprise you here. Just a simple test-only module contains local function unit tests. The problem is - this test doesn't build yet. We need to tweak our message types a bit. Update the src/msg.rs: # use serde::{Deserialize, Serialize};
# #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
pub struct GreetResp { pub message: String,
} #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
pub enum QueryMsg { Greet {},
} I added three new derives to both message types. PartialEq is required to allow comparing types for equality - so we can check if they are equal. The Debug is a trait generating debug-printing utilities. It is used by assert_eq! to display information about mismatch if an assertion fails. Note that because we are not testing the QueryMsg in any way, the additional trait derives are optional. Still, it is a good practice to make all messages both PartialEq and Debug for testability and consistency. The last one, Clone is not needed for now yet, but it is also good practice to allow messages to be cloned around. We will also require that later, so I added it already not to go back and forth. Now we are ready to run our test: $ cargo test ...
running 1 test
test contract::tests::greet_query ... ok test result: ok. 1 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s Yay! Test passed!

18.body:
Now let's go a step further. The Rust testing utility is a friendly tool for building even higher-level tests. We are currently testing smart contract internals, but if you think about how your smart contract is visible from the outside world. It is a single entity that is triggered by some input messages. We can create tests that treat the whole contract as a black box by testing it via our query function. Let's update our test: # use crate::msg::{GreetResp, QueryMsg};
# use cosmwasm_std::{
# to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# # pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
# # pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> {
# use QueryMsg::*;
# # match msg {
# Greet {} => to_binary(&query::greet()?),
# }
# }
# # mod query {
# use super::*;
# # pub fn greet() -> StdResult<GreetResp> {
# let resp = GreetResp {
# message: "Hello World".to_owned(),
# };
# # Ok(resp)
# }
# }
# #[cfg(test)]
mod tests { use cosmwasm_std::from_binary; use cosmwasm_std::testing::{mock_dependencies, mock_env}; use super::*; #[test] fn greet_query() { let resp = query( mock_dependencies().as_ref(), mock_env(), QueryMsg::Greet {} ).unwrap(); let resp: GreetResp = from_binary(&resp).unwrap(); assert_eq!( resp, GreetResp { message: "Hello World".to_owned() } ); }
} We needed to produce two entities for the query functions: the deps and env instances. Fortunately, cosmwasm-std provides utilities for testing those - mock_dependencies and mock_env functions. You may notice the dependencies mock of a type OwnedDeps instead of Deps, which we need here - this is why the as_ref function is called on it. If we looked for a DepsMut object, we would use as_mut instead. We can rerun the test, and it should still pass. But when we think about that test reflecting the actual use case, it is inaccurate. The contract is queried, but it was never instantiated! In software engineering, it is equivalent to calling a getter without constructing an object - taking it out of nowhere. It is a lousy testing approach. We can do better: # use crate::msg::{GreetResp, QueryMsg};
# use cosmwasm_std::{
# to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# # pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
# # pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> {
# use QueryMsg::*;
# # match msg {
# Greet {} => to_binary(&query::greet()?),
# }
# }
# # mod query {
# use super::*;
# # pub fn greet() -> StdResult<GreetResp> {
# let resp = GreetResp {
# message: "Hello World".to_owned(),
# };
# # Ok(resp)
# }
# }
# #[cfg(test)]
mod tests { use cosmwasm_std::from_binary; use cosmwasm_std::testing::{mock_dependencies, mock_env, mock_info}; use super::*; #[test] fn greet_query() { let mut deps = mock_dependencies(); let env = mock_env(); instantiate( deps.as_mut(), env.clone(), mock_info("sender", &[]), Empty {}, ) .unwrap(); let resp = query(deps.as_ref(), env, QueryMsg::Greet {}).unwrap(); let resp: GreetResp = from_binary(&resp).unwrap(); assert_eq!( resp, GreetResp { message: "Hello World".to_owned() } ); }
} A couple of new things here. First, I extracted the deps and env variables to their variables and passed them to calls. The idea is that those variables represent some blockchain persistent state, and we don't want to create them for every call. We want any changes to the contract state occurring in instantiate to be visible in the query. Also, we want to control how the environment differs on the query and instantiation. The info argument is another story. The message info is unique for each message sent. To create the info mock, we must pass two arguments to the mock_info function. First is the address performing a call. It may look strange to pass sender as an address instead of some mysterious wasm followed by hash, but it is a valid address. For testing purposes, such addresses are typically better, as they are way more verbose in case of failing tests. The second argument is funds sent with the message. For now, we leave it as an empty slice, as I don't want to talk about token transfers yet - we will cover it later. So now it is more a real-case scenario. I see just one problem. I say that the contract is a single black box. But here, nothing connects the instantiate call to the corresponding query. It seems that we assume there is some global contract. But it seems that if we would like to have two contracts instantiated differently in a single test case, it would become a mess. If only there would be some tool to abstract this for us, wouldn't it be nice?

19.body:
Let me introduce the multitest - library for creating tests for smart contracts in Rust. The core idea of multitest is abstracting an entity of contract and simulating the blockchain environment for testing purposes. The purpose of this is to be able to test communication between smart contracts. It does its job well, but it is also an excellent tool for testing single-contract scenarios. First, we need to add a multitest to our Cargo.toml. [package]
name = "contract"
version = "0.1.0"
edition = "2021" [lib]
crate-type = ["cdylib"] [dependencies]
cosmwasm-std = { version = "1.0.0-beta8", features = ["staking"] }
serde = { version = "1.0.103", default-features = false, features = ["derive"] } [dev-dependencies]
cw-multi-test = "0.13.4" I added a new [dev-dependencies] section with dependencies not used by the final binary but which may be used by tools around the development process - for example, tests. When we have the dependency ready, update our test to use the framework: # use crate::msg::{GreetResp, QueryMsg};
# use cosmwasm_std::{
# to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# # pub fn instantiate(
# _deps: DepsMut,
# _env: Env,
# _info: MessageInfo,
# _msg: Empty,
# ) -> StdResult<Response> {
# Ok(Response::new())
# }
# # pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> {
# use QueryMsg::*;
# # match msg {
# Greet {} => to_binary(&query::greet()?),
# }
# }
# #[allow(dead_code)]
pub fn execute( _deps: DepsMut, _env: Env, _info: MessageInfo, _msg: Empty
) -> StdResult<Response> { unimplemented!()
} # mod query {
# use super::*;
# # pub fn greet() -> StdResult<GreetResp> {
# let resp = GreetResp {
# message: "Hello World".to_owned(),
# };
# # Ok(resp)
# }
# }
# #[cfg(test)]
mod tests { use cosmwasm_std::Addr; use cw_multi_test::{App, ContractWrapper, Executor}; use super::*; #[test] fn greet_query() { let mut app = App::default(); let code = ContractWrapper::new(execute, instantiate, query); let code_id = app.store_code(Box::new(code)); let addr = app .instantiate_contract( code_id, Addr::unchecked("owner"), &Empty {}, &[], "Contract", None, ) .unwrap(); let resp: GreetResp = app .wrap() .query_wasm_smart(addr, &QueryMsg::Greet {}) .unwrap(); assert_eq!( resp, GreetResp { message: "Hello World".to_owned() } ); }
} You probably notice that I added the function for an execute entry point. I didn't add the entry point itself or the function's implementation, but for the multitest purposes contract has to contain at least instantiate, query, and execute handlers. I attributed the function as #[allow(dead_code)] , so, cargo will not complain about it not being used anywhere. Enabling it for tests only with #[cfg(test)] would also be a way. Then at the beginning of the test, I created the App object. It is a core multitest entity representing the virtual blockchain on which we will run our contracts. As you can see, we can call functions on it just like we would interact with blockchain using wasmd! Right after creating app, I prepared the representation of the code, which would be "uploaded" to the blockchain. As multitests are just native Rust tests, they do not involve any Wasm binaries, but this name matches well what happens in a real-life scenario. We store this object in the blockchain with the store_code function, and as a result, we are getting the code id - we would need it to instantiate a contract. Instantiation is the next step. In a single instantiate_contract call, we provide everything we would provide via wasmd - the contract code id, the address which performs instantiation, the message triggering it, and any funds sent with the message (again - empty for now). We are adding the contract label and its admin for migrations - None, as we don't need it yet. And after the contract is online, we can query it. The wrap function is an accessor for querying Api (queries are handled a bit differently than other calls), and the query_wasm_smart queries are given a contract with the message. Also, we don't need to care about query results as Binary - multitest assumes that we would like to deserialize them to some response type, so it takes advantage of Rust type elision to provide us with a nice Api. Now it's time to rerun the test. It should still pass, but now we nicely abstracted the testing contract as a whole, not some internal functions. The next thing we should probably cover is making the contract more interesting by adding some state.

20.body:
The contract we are working on already has some behavior that can answer a query. Unfortunately, it is very predictable with its answers, and it has nothing to alter them. In this chapter, I introduce the notion of state, which would allow us to bring true life to a smart contract. The state would still be static for now - it would be initialized on contract instantiation. The state would contain a list of admins who would be eligible to execute messages in the future. The first thing to do is to update Cargo.toml with yet another dependency - the storage-plus crate with high-level bindings for CosmWasm smart contracts state management: [package]
name = "contract"
version = "0.1.0"
edition = "2021" [lib]
crate-type = ["cdylib"] [dependencies]
cosmwasm-std = { version = "1.0.0-beta8", features = ["staking"] }
serde = { version = "1.0.103", default-features = false, features = ["derive"] }
cw-storage-plus = "0.13.4" [dev-dependencies]
cw-multi-test = "0.13.4" Now create a new file where you will keep a state for the contract - we typically call it src/state.rs: use cosmwasm_std::Addr;
use cw_storage_plus::Item; pub const ADMINS: Item<Vec<Addr>> = Item::new("admins"); And make sure we declare the module in src/lib.rs: # use cosmwasm_std::{
# entry_point, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# # mod contract;
# mod msg;
mod state;
#
# #[entry_point]
# pub fn instantiate(deps: DepsMut, env: Env, info: MessageInfo, msg: Empty)
# -> StdResult<Response>
# {
# contract::instantiate(deps, env, info, msg)
# }
#
# #[entry_point]
# pub fn query(deps: Deps, env: Env, msg: msg::QueryMsg)
# -> StdResult<Binary>
# {
# contract::query(deps, env, msg)
# } The new thing we have here is the ADMINS constant of type Item<Vec<Addr>>. You could ask an excellent question here - how is the state constant? How do I modify it if it is a constant value? The answer is tricky - this constant is not keeping the state itself. The state is stored in the blockchain and is accessed via the deps argument passed to entry points. The storage-plus constants are just accessor utilities helping us access this state in a structured way. In CosmWasm, the blockchain state is just massive key-value storage. The keys are prefixed with metainformation pointing to the contract which owns them (so no other contract can alter them in any way), but even after removing the prefixes, the single contract state is a smaller key-value pair. storage-plus handles more complex state structures by additionally prefixing items keys intelligently. For now, we just used the simplest storage entity - an Item<_> , which holds a single optional value of a given type - Vec<Addr> in this case. And what would be a key to this item in the storage? It doesn't matter to us - it would be figured out to be unique, based on a unique string passed to the new function. Before we would go into initializing our state, we need some better instantiate message. Go to src/msg.rs and create one: # use cosmwasm_std::Addr;
# use serde::{Deserialize, Serialize};
# #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
pub struct InstantiateMsg { pub admins: Vec<String>,
}
# # #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
# pub struct GreetResp {
# pub message: String,
# }
# # #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
# pub enum QueryMsg {
# Greet {},
# } Now go forward to instantiate the entry point in src/contract.rs, and initialize our state to whatever we got in the instantiation message: # use crate::msg::{GreetResp, InstantiateMsg, QueryMsg};
use crate::state::ADMINS;
// --snip--
# use cosmwasm_std::{
# to_binary, Binary, Deps, DepsMut, Empty, Env, MessageInfo, Response, StdResult,
# };
# pub fn instantiate( deps: DepsMut, _env: Env, _info: MessageInfo, msg: InstantiateMsg,
) -> StdResult<Response> { let admins: StdResult<Vec<_>> = msg .admins .into_iter() .map(|addr| deps.api.addr_validate(&addr)) .collect(); ADMINS.save(deps.storage, &admins?)?; Ok(Response::new())
}
# # pub fn query(_deps: Deps, _env: Env, msg: QueryMsg) -> StdResult<Binary> {
# use QueryMsg::*;
# # match msg {
# Greet {} => to_binary(&query::greet()?),
# }
# }
# # #[allow(dead_code)]
# pub fn execute(_deps: DepsMut, _env: Env, _info: MessageInfo, _msg: Empty) -> StdResult<Response> {
# unimplemented!()
# }
# # mod query {
# use super::*;
# # pub fn greet() -> StdResult<GreetResp> {
# let resp = GreetResp {
# message: "Hello World".to_owned(),
# };
# # Ok(resp)
# }
# }
# # #[cfg(test)]
# mod tests {
# use cosmwasm_std::Addr;
# use cw_multi_test::{App, ContractWrapper, Executor};
# # use super::*;
# # #[test]
# fn greet_query() {
# let mut app = App::default();
# # let code = ContractWrapper::new(execute, instantiate, query);
# let code_id = app.store_code(Box::new(code));
# # let addr = app
# .instantiate_contract(
# code_id,
# Addr::unchecked("owner"),
# &Empty {},
# &[],
# "Contract",
# None,
# )
# .unwrap();
# # let resp: GreetResp = app
# .wrap()
# .query_wasm_smart(addr, &QueryMsg::Greet {})
# .unwrap();
# # assert_eq!(
# resp,
# GreetResp {
# message: "Hello World".to_owned()
# }
# );
# }
# } We also need to update the message type on entry point in src/lib.rs: # use cosmwasm_std::{entry_point, Binary, Deps, DepsMut, Env, MessageInfo, Response, StdResult};
use msg::InstantiateMsg;
// --snip--
# # mod contract;
# mod msg;
# mod state;
# #[entry_point]
pub fn instantiate( deps: DepsMut, env: Env, info: MessageInfo, msg: InstantiateMsg,
) -> StdResult<Response> { contract::instantiate(deps, env, info, msg)
}
# # #[entry_point]
