In our contract, we now have an error situation when a user tries to execute AddMembers not being an admin himself. There is no proper error case in StdError to report this situation, so we have to return a generic error with a message. It is not the best approach. For error reporting, we encourage using thiserror crate. Start with updating your dependencies: [package]
