pub enum ContractError { #[error("{0}")] StdError(#[from] StdError), #[error("{sender} is not contract admin")] Unauthorized { sender: Addr }, #[error("Payment error: {0}")] Payment(#[from] PaymentError),
} As you can see, to handle incoming funds, I used the utility function - I encourage you to take a look at its implementation - this would give you a good understanding of how incoming funds are structured in MessageInfo. Now it's time to check if the funds are distributed correctly. The way for that is to write a test. # use crate::error::ContractError;
