Due to Rust style, all our message variants are spelled in a camel-case . It is standard practice, but it has a drawback - all messages are serialized and deserialized by serde using those variant names. The problem is that it is more common to use snake cases for field names in the JSON world. Fortunately, there is an effortless way to tell serde, to change the names casing for serialization purposes. Let's update our messages with a #[serde] attribute: use cosmwasm_std::Addr;
