#[serde(rename_all = "snake_case")]
pub struct InstantiateMsg { pub admins: Vec<String>, pub donation_denom: String,
} #[derive(Serialize, Deserialize, PartialEq, Debug, Clone)]
#[serde(rename_all = "snake_case")]
