name = "contract"
version = "0.1.0"
edition = "2021" [lib]
crate-type = ["cdylib", "rlib"] [dependencies]
cosmwasm-std = { version = "1.1.4", features = ["staking"] }
serde = { version = "1.0.103", default-features = false, features = ["derive"] }
cw-storage-plus = "0.15.1"
thiserror = "1"
schemars = "0.8.1"
cosmwasm-schema = "1.1.4" [dev-dependencies]
cw-multi-test = "0.13.4" There is one additional change in this file - in crate-type I added "rlib". "cdylib" crates cannot be used as typical Rust dependencies. As a consequence, it is impossible to create examples for such crates. Now go back to src/msg.rs and add a new derive for all messages: # use cosmwasm_std::Addr;
