} #[derive(Serialize, Deserialize, PartialEq, Debug, Clone, JsonSchema)]
#[serde(rename_all = "snake_case")]
pub struct GreetResp { pub message: String,
} #[derive(Serialize, Deserialize, PartialEq, Debug, Clone, JsonSchema)]
#[serde(rename_all = "snake_case")]
pub struct AdminsListResp { pub admins: Vec<Addr>,
} #[derive(Serialize, Deserialize, PartialEq, Debug, Clone, JsonSchema)]
#[serde(rename_all = "snake_case")]
pub enum QueryMsg { Greet {}, AdminsList {},
} You may argue that all those derives look slightly clunky, and I agree. Fortunately, the cosmwasm-schema crate delivers a utility cw_serde macro, which we can use to reduce a boilerplate: # use cosmwasm_std::Addr;
use cosmwasm_schema::cw_serde #[cw_serde]
pub struct InstantiateMsg { pub admins: Vec<String>, pub donation_denom: String,
} #[cw_serde]
pub enum ExecuteMsg { AddMembers { admins: Vec<String> }, Leave {}, Donate {},
} #[cw_serde]
