} #[cw_serde]
pub struct AdminsListResp { pub admins: Vec<Addr>,
} #[cw_serde]
pub enum QueryMsg { Greet {}, AdminsList {},
} Additionally, we have to derive the additional QueryResponses trait for our query message to correlate the message variants with responses we would generate for them: # use cosmwasm_std::Addr;
use cosmwasm_schema::{cw_serde, QueryResponses} # #[cw_serde]
# pub struct InstantiateMsg {
# pub admins: Vec<String>,
# pub donation_denom: String,
# }
# # #[cw_serde]
# pub enum ExecuteMsg {
# AddMembers { admins: Vec<String> },
# Leave {},
# Donate {},
# }
# # #[cw_serde]
# pub struct GreetResp {
# pub message: String,
# }
# # #[cw_serde]
# pub struct AdminsListResp {
# pub admins: Vec<Addr>,
# }
# #[cw_serde]
#[derive(QueryResponses)]
pub enum QueryMsg { #[returns(GreetResp)] Greet {}, #[returns(AdminsListResp)] AdminsList {},
} The QueryResponses is a trait that requires the #[returns(...)] attribute to all your query variants to generate additional information about the query-response relationship. Now, we want to make the msg module public and accessible by crates depending on our contract (in this case - for schema example). Update a src/lib.rs: # use cosmwasm_std::{entry_point, Binary, Deps, DepsMut, Env, MessageInfo, Response, StdResult};
