# } I changed the visibility of all modules - as our crate can now be used as a dependency. If someone would like to do so, he may need access to handlers or state. The next step is to create a tool generating actual schemas. We will do it by creating an binary in our crate. Create a new bin/schema.rs file: use contract::msg::{ExecuteMsg, InstantiateMsg, QueryMsg};
use cosmwasm_schema::write_api; fn main() { write_api! { instantiate: InstantiateMsg, execute: ExecuteMsg, query: QueryMsg }
} Cargo is smart enough to recognize files in src/bin directory as utility binaries for the crate. Now we can generate our schemas: $ cargo run schema Finished dev [unoptimized + debuginfo] target(s) in 0.52s Running `target/debug/schema schema`
Removing "/home/hashed/confio/git/book/examples/03-basics/schema/contract.json" …
