library = [] This way, we created a new feature for our crate. Now we want to disable the entry_point attribute on entry points - we will do it by a slight update of src/lib.rs: # use cosmwasm_std::{entry_point, Binary, Deps, DepsMut, Env, MessageInfo, Response, StdResult};
# use error::ContractError;
# use msg::{ExecuteMsg, InstantiateMsg, QueryMsg};
# # pub mod contract;
# pub mod error;
# pub mod msg;
# pub mod state;
# #[cfg_attr(not(feature = "library"), entry_point)]
pub fn instantiate( deps: DepsMut, env: Env, info: MessageInfo, msg: InstantiateMsg,
) -> StdResult<Response> { contract::instantiate(deps, env, info, msg)
} #[cfg_attr(not(feature = "library"), entry_point)]
pub fn execute( deps: DepsMut, env: Env, info: MessageInfo, msg: ExecuteMsg,
) -> Result<Response, ContractError> { contract::execute(deps, env, info, msg)
} #[cfg_attr(not(feature = "library"), entry_point)]
pub fn query(deps: Deps, env: Env, msg: QueryMsg) -> StdResult<Binary> { contract::query(deps, env, msg)
} The cfg_attr attribute is a conditional compilation attribute, similar to the cfg we used before for the test. It expands to the given attribute if the condition expands to true. In our case - it would expand to nothing if the feature "library" is enabled, or it would expand just to #[entry_point] in another case. Since now to add this contract as a dependency, don't forget to enable the feature like this: [dependencies]
my_contract = { version = "0.1", features = ["library"] }

