First, let's define a map - in this context, it would be a set of keys with values assigned to them, just like a HashMap in Rust or dictionaries in many languages. We define it as similar to an Item, but this time we need two types - the key type and the value type: use cw_storage_plus::Map; pub const STR_TO_INT_MAP: Map<String, u64> = Map::new("str_to_int_map"); Then to store some items on the Map , we use a save method - same as for an Item: STR_TO_INT_MAP.save(deps.storage, "ten".to_owned(), 10);
STR_TO_INT_MAP.save(deps.storage, "one".to_owned(), 1); Accessing entries in the map is also as easy as reading an item: let ten = STR_TO_INT_MAP.load(deps.storage, "ten".to_owned())?;
assert_eq!(ten, 10); let two = STR_TO_INT_MAP.may_load(deps.storage, "two".to_owned())?;
assert_eq!(two, None); Obviously, if the element is missing in the map, the load function will result in an error - just like for an item. On the other hand - may_load returns a Some variant when element exits. Another very useful accessor that is specific to the map is the has function, which checks for the existence of the key in the map: let contains = STR_TO_INT_MAP.has(deps.storage, "three".to_owned())?;
assert!(!contains); Finally, we can iterate over elements of the maps - either its keys or key-value pairs: use cosmwasm_std::Order; for k in STR_TO_INT_MAP.keys(deps.storage, None, None, Order::Ascending) { let _addr = deps.api.addr_validate(k?);
} for item in STR_TO_INT_MAP.range(deps.storage, None, None, Order::Ascending) { let (_key, _value) = item?;
} First, you might wonder about extra values passed to keys and range - those are in order: lower and higher bounds of iterated elements, and the order elements should be traversed. While working with typical Rust iterators, you would probably first create an iterator over all the elements and then somehow skip those you are not interested in. After that, you will stop after the last interesting element. It would more often than not require accessing elements you filter out, and this is the problem - it requires reading the element from the storage. And reading it from the storage is the expensive part of working with data, which we try to avoid as much as possible. One way to do it is to instruct the Map where to start and stop deserializing elements from storage so it never reaches those outside the range. Another critical thing to notice is that the iterator returned by both keys and range functions are not iterators over elements - they are iterators over Results. It is a thing because, as it is rare, it might be that item is supposed to exist, but there is some error while reading from storage - maybe the stored value is serialized in a way we didn't expect, and deserialization fails. This is actually a real thing that happened in one of the contracts I worked on in the past - we changed the value type of the Map, and then forgot to migrate it, which caused all sorts of problems.

