So I imagine you can call me crazy right now - why do I spam about a Map, while we are working with vector? It is clear that those two represent two distinct things! Or do they? Let's reconsider what we keep in the ADMINS vector - we have a list of objects which we expect to be unique, which is a definition of a mathematical set. So now let me bring back my initial definition of the map: First, let's define a map - in this context, it would be a set of keys with values assigned to them, just like a HashMap in Rust or dictionaries in many languages. I purposely used the word "set" here - the map has the set built into it. It is a generalization of a set or reversing the logic - the set is a particular case of a map. If you imagine a set that map every single key to the same value, then the values become irrelevant, and such a map becomes a set semantically. How can you make a map mapping all the keys to the same value? We pick a type with a single value. Typically in Rust, it would be a unit type (()), but in CosmWasm, we tend to use the Empty type from CW standard crate: use cosmwasm_std::{Addr, Empty};
use cw_storage_plus::Map; pub const ADMINS: Map<Addr, Empty> = Map::new("admins"); We now need to fix the usage of the map in our contract. Let's start with contract instantiation: use crate::msg::InstantiateMsg;
use crate::state::{ADMINS, DONATION_DENOM};
use cosmwasm_std::{ DepsMut, Empty, Env, MessageInfo, Response, StdResult,
}; pub fn instantiate( deps: DepsMut, _env: Env, _info: MessageInfo, msg: InstantiateMsg,
) -> StdResult<Response> { for addr in msg.admins { let admin = deps.api.addr_validate(&addr)?; ADMINS.save(deps.storage, admin, &Empty {})?; } DONATION_DENOM.save(deps.storage, &msg.donation_denom)?; Ok(Response::new())
} It didn't simplify much, but we no longer need to collect our address. Then let's move to the leaving logic: use crate::state::ADMINS;
use cosmwasm_std::{DepsMut, MessageInfo}; pub fn leave(deps: DepsMut, info: MessageInfo) -> StdResult<Response> { ADMINS.remove(deps.storage, info.sender.clone()); let resp = Response::new() .add_attribute("action", "leave") .add_attribute("sender", info.sender.as_str()); Ok(resp)
} Here we see a difference - we don't need to load a whole vector. We remove a single entry with the remove function. What I didn't emphasize before, and what is relevant, is that Map stores every single key as a distinct item. This way, accessing a single element will be cheaper than using a vector. However, this has its downside - accessing all the elements is more gas-consuming using Map! In general, we tend to avoid such situations - the linear complexity of the contract might lead to very expensive executions (gas-wise) and potential vulnerabilities - if the user finds a way to create many dummy elements in such a vector, he may make the execution cost exceeding any gas limit. Unfortunately, we have such an iteration in our contract - the distribution flow becomes as follows: use crate::error::ContractError;
use crate::state::{ADMINS, DONATION_DENOM};
use cosmwasm_std::{ coins, BankMsg,DepsMut, MessageInfo, Order, Response
}; pub fn donate(deps: DepsMut, info: MessageInfo) -> Result<Response, ContractError> { let denom = DONATION_DENOM.load(deps.storage)?; let admins: Result<Vec<_>, _> = ADMINS .keys(deps.storage, None, None, Order::Ascending) .collect(); let admins = admins?; let donation = cw_utils::must_pay(&info, &denom)?.u128(); let donation_per_admin = donation / (admins.len() as u128); let messages = admins.into_iter().map(|admin| BankMsg::Send { to_address: admin.to_string(), amount: coins(donation_per_admin, &denom), }); let resp = Response::new() .add_messages(messages) .add_attribute("action", "donate") .add_attribute("amount", donation.to_string()) .add_attribute("per_admin", donation_per_admin.to_string()); Ok(resp)
} If I had to write a contract like this, and this donate would be a critical, often called flow, I would advocate for going for an Item<Vec<Addr>> here. Fortunately, it is not the case - the distribution does not have to be linear in complexity! It might sound a bit crazy, as we have to iterate over all receivers to distribute funds, but this is not true - there is a pretty nice way to do so in constant time, which I will describe later in the book. For now, we will leave it as it is, acknowledging the flaw of the contract, which we will fix later. The final function to fix is the admins_list query handler: use crate::state::ADMINS;
use cosmwasm_std::{Deps, Order, StdResult}; pub fn admins_list(deps: Deps) -> StdResult<AdminsListResp> { let admins: Result<Vec<_>, _> = ADMINS .keys(deps.storage, None, None, Order::Ascending) .collect(); let admins = admins?; let resp = AdminsListResp { admins }; Ok(resp)
} Here we also have an issue with linear complexity, but it is far less of a problem. First, queries are often purposed to be called on local nodes, with no gas cost - we can query contracts as much as we want. And then, even if we have some limit on execution time/cost, there is no reason to query all the items every single time! We will fix this function later, adding pagination - to limit the execution time/cost of the query caller would be able to ask for a limited amount of items starting from the given one. Knowing this chapter, you can probably figure implementation of it right now, but I will show the common way we do that when I go through common CosmWasm practices.

