The concept of time in the blockchain is tricky - as in every distributed system, it is not easy to synchronize the clocks of all the nodes. However, there is the notion of a time that is even monotonic - which means that it should never go "backward" between executions. Also, what is important is - time is always unique throughout the whole transaction - and even the entire block, which is built of multiple transactions. The time is encoded in the Env type in its block field, which looks like this: pub struct BlockInfo { pub height: u64, pub time: Timestamp, pub chain_id: String,
} You can see the time field, which is the timestamp of the processed block. The height field is also worth mentioning - it contains a sequence number of the processed block. It is sometimes more useful than time, as it is guaranteed that the height field is guaranteed to increase between blocks, while two blocks may be executed with the same time (even though it is rather not probable). Also, many transactions might be executed in a single block. That means that if we need a unique id for the execution of a particular message, we should look for something more. This thing is a transaction field of the Env type: pub struct TransactionInfo { pub index: u32,
} The index here contains a unique index of the transaction in the block. That means that to get the unique identifier of a transaction through the whole block, we can use the (height, transaction_index) pair.

